  [],\n\t\"revision_timestamp\": \"2016-07-27T22:51:39.628825\",\n\t\"name\": \"bear-river-migratory-bird-refuge-annual-narrative-report-calendar-year-1980\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Bear River
  Migratory Bird Refuge outlines Refuge accomplishments during the 1980 calendar year.
  The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses the master plan, management
  planning, public participation, compliance with environmental and cultural resource
  mandates, and research and investigations. Refuge administration is outlined; information
  about personnel, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, fire management, pest control, water
  rights, and wilderness areas. The wildlife section of the report discusses wildlife
  diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, game mammals, fisheries resources, surplus animal disposal,
  scientific collections, animal control, marking and bird banding, and disease control.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, hunting, fishing, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, communication
  systems, and energy conservation. Items of interest are provided at the end.\",\n\t\"license_title\":
